import "./UpperTownSection.css";
const UpperTownSection = () => {
  return (
    <div className="homepage-child">
      <div className="zagreb-must-visits-parent">
        <div className="zagreb-must-visits">Zagreb must visits</div>
        <div className="upper-town">Upper Town</div>
        <div className="main-square">Main square</div>
        <div className="maksimir-park">Maksimir Park</div>
        <div className="jarun-lake">Jarun Lake</div>
        <div className="zagrebs-upper-town">
          Zagreb's Upper Town, or the Old Town, is a captivating destination
          with its medieval charm, cobblestone streets, and historic landmarks
          like St. Mark's Church and Zagreb Cathedral. This hilltop area offers
          panoramic views, quaint cafes, and cultural sites that showcase the
          city's heritage. It's a must-visit spot for experiencing Zagreb's rich
          history and vibrant atmosphere.
        </div>
        <div className="line-div" />
        <img className="vector-icon1" alt="" src="/vector1.svg" />
      </div>
    </div>
  );
};

export default UpperTownSection;
